description:
Flashpoint: South China Sea

Sociopolitical Documentary hosted by Rupert Wingfield-Hayes, published by BBC broadcasted as part of BBC Our World series in 2014 - English narration


Information
------------------------------

Could the next super-power conflict erupt in the South China Sea? For 70 years the US navy has sailed the western pacific virtually unopposed. But China is now modernising its navy, fortifying its fleet with nuclear submarines, aircraft carriers and long range missiles. It's also attempting to force the Philippines and Vietnam off disputed reefs and spending billions building new island bases more than a thousand kilometres from its own shores. Rupert Wingfield Hayes heads to the disputed Spratley Islands to find out how America will respond to this new expansionist challenge from China.

